                            margin-left:5%;
                            margin-right:2%;
                            margin-bottom:5%;
                            width:45%;

                        }
                        .addtocart_cardtwo{
                            background-color: white;
                            display:block;
                            margin-right:5%;
                            margin-bottom:5%;
                            width:45%;
