                            padding: 2% 10% 2% 5%;
                            letter-spacing: 1px;
                            font-size: 18px;
                        }
                        .addtocart_button{
                            background-color:#ed3833;
                            color: white;
                            padding:8px;
                            display: block;
                            margin:auto;
                            margin-top:10px;
                            margin-bottom:10px;
                            border-radius: 6px;
                        }
                        .brackets_shit{
                            display:block;
                            margin:auto;
                            width:100%;
                            text-align:center;
                            font-size:13px;
                            color:white;

                        }
                        .container_3buttons{
                            display:flex;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            margin-top:7%;

                        }
                         .benefits_div{
                            background-color:#e7e6e6;
                            display:flex;
                            padding-left:5%;
                            padding-right:5%;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            border-right:2px solid white;
                            width:100%;
                         }
                         .benefits_div:hover{
                             border-bottom:2px solid red;
                         }
                         .benefits{
                            text-align:center;
                            color: #58595f;
                            font-size:10px;
                            display:block;
                            margin:auto;
                            letter-spacing:2px;
                            font-weight:bold;
                         }
                         .price_comp_div{
                            background-color:#e7e6e6;
                            display:flex;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            padding-left:5%;
                            padding-right:5%;
                            padding-top:2%;
                            padding-bottom:2%;
                            border-right:2px solid white;

                            width:100%;                            
                         }
                         .price_comp{

                            text-align:center;
                            color: #58595f;
                            font-size:10px;
                            display:block;
                            margin:auto;
                            letter-spacing:2px;
                            font-weight:bold;
                         }
                         .faqs_div{

                            background-color:#e7e6e6;
                            display:flex;
                            padding-left:5%;
                            padding-right:5%;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            width:100%;
                         }
                         .faqs{
                            text-align:center;
                            color: #58595f;
                            font-size:10px;
                            display:block;
                            margin:auto;
                            letter-spacing:2px;
                            font-weight:bold;  
                         }
                         .section_title_wrapper{
                             text-align:center;
                             white-space:nowrap;
                             overflow:hidden;
                             display:block;
                             margin-top:5%;
                         }
                         .section_title{
                            position: relative;
                            display: inline-block;
                            font-size: 15px;
                            letter-spacing: 2px;
                            font-weight:bold;
                            color: #ed2d2f;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                         }
                         .section_title:before{
                            right: 100%;
                            margin-right: 10%;
                         }
                         .section_title:after{
                            left: 100%;
                            margin-left: 10%;
                         }
                         .section_title:before, .section_title:after{
                            content: "";
                            position: absolute;
                            top: 50%;
                            width: 9999px;
                            height: 10px;
                            background-image: initial;
                            background-position-x: initial;
                            background-position-y: initial;
                            background-size: initial;
                            background-repeat-x: initial;
                            background-repeat-y: initial;
                            background-attachment: initial;
                            background-origin: initial;
                            background-clip: initial;
                            background-color: rgb(203, 80, 87);
                         }
                         .table_wrapper{
                             overflow:hidden;
                         }
                         .price-list{
                            max-width: 600px;
                            margin: auto;
                         }

                    }



                `}

            </style>
        </Head>
