            <div class="container_exclusive_banner">
                <div class="left_teal" >
                    <p>
                        <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                        <p class="teal_banner_line2"> AT AN </p>
                        <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 
                        <p class="brackets_shit">(Adding membership to cart will unlock Exclusive prices instantly)</p>

                    </p>
                </div>
                <div class="right_teal">
                    <div class="addtocart_cardone">
                            <p class="upper"> MONTHLY </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 149/- pm</p>
                            <p class="instant_access">Get instant access 
                                for a full month.</p>
                            <h3 class="price">@ Rs. 149/-</h3>  
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                    <div class="addtocart_cardtwo">
                            <p class="upper"> ANNUAL </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 25/- pm</p>
                            <p class="instant_access">Get instant access 
                                for a full year.</p>
                            <h3 class="price">@ Rs. 299/-</h3>   
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                </div>   
                </div>    
            <div class="container_3buttons">
                    <div class="benefits_div">
                            <p class="benefits"> BENEFITS </p>
                    </div>
                    <div class="price_comp_div">
                            <p class="price_comp"> PRICE COMPARISON </p>
                    </div>
                    <div class="faqs_div">
                            <p class="faqs"> FAQS </p>
                    </div>
            </div>  
            <div class="section_title_wrapper">

                <span class="section_title">BENEFITS</span>

            </div>  
            <div>
                <amp-img alt="Discounted Prices"  
                width="900"
                height="300"
                layout="responsive">
                </amp-img>
            </div>
            <div class="section_title_wrapper">

                <span class="section_title">PRICE COMPARISON</span>

            </div>  
            <div class="table_wrapper">
                        <table><thead class="text-uppercase"><tr><th>Product</th> <th>Current Price</th> <th>Exclusive Prices</th></tr></thead> <tbody><tr><td class="text-uppercase">T-shirts</td> <td class="grey">Rs. 499 - Rs. 699</td> <td>Rs. 199 onwards</td></tr> <tr><td class="text-uppercase">T-shirt Dresses</td> <td class="grey">Rs. 599 - Rs. 699</td> <td>Rs. 349 onwards</td></tr> <tr><td class="text-uppercase">Full Sleeve T-shirts</td> <td class="grey">Rs. 599</td> <td>Rs. 399 onwards</td></tr> <tr><td class="text-uppercase">Tank Tops</td> <td class="grey">Rs. 349 - Rs. 399</td> <td>Rs. 249 onwards</td></tr> <tr><td class="text-uppercase">Vests</td> <td class="grey">Rs. 399</td> <td>Rs. 249 onwards</td></tr> <tr><td class="text-uppercase">Boxers</td> <td class="grey">Rs. 399</td> <td>Rs. 199 onwards</td></tr> <tr><td class="text-uppercase">Backpacks</td> <td class="grey">Rs. 899 - Rs. 999</td> <td>Rs. 599 onwards</td></tr> <tr><td class="text-uppercase">Mobile Covers</td> <td class="grey">Rs. 299 - Rs. 599</td> <td>Rs. 299 onwards</td></tr> <tr><td class="text-uppercase">Hoodies</td> <td class="grey">Rs. 949</td> <td>Rs. 599 onwards</td></tr> <tr><td class="text-uppercase">Socks</td> <td class="grey">Rs. 249</td> <td>Rs. 99 onwards</td></tr> <tr><td class="text-uppercase">Notebooks</td> <td class="grey">Rs. 199</td> <td>Rs. 99 onwards</td></tr> <tr><td class="text-uppercase">Mugs</td> <td class="grey">Rs. 249 - Rs. 499</td> <td>Rs. 199 onwards</td></tr> <tr><td class="text-uppercase">Badges</td> <td class="grey">Rs. 49</td> <td>Rs. 19 onwards</td></tr> <tr><td class="text-uppercase">Stickers</td> <td class="grey">Rs. 49</td> <td>Rs. 19 onwards</td></tr> <tr><td class="text-uppercase">Pins</td> <td class="grey">Rs. 149</td> <td>Rs. 79 onwards</td></tr> <tr><td class="text-uppercase">Flip flops</td> <td class="grey">Rs. 499</td> <td>Rs. 199 onwards</td></tr> <tr><td class="text-uppercase">Caps</td> <td class="grey">Rs. 699</td> <td>Rs. 199 onwards</td></tr> <tr><td class="text-uppercase">Keychains</td> <td class="grey">Rs. 149</td> <td>Rs. 79 onwards</td></tr></tbody></table>
            </div>
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
